import React from 'react';

const Home = () => {
  return (

    <div className="image-container">
      <div>
      <div>
      <img
        src="./assets/eagl.png"
        className="card-img"
        alt="Background"
      />
      </div>

      <div>
          <img
        src="./assets/2.jpeg"
        className="card-img"
        alt="Background"
      />
      </div>

    </div>
      <h5 className="cart-title display-3 fw-bolder mb-0">New Released Products</h5>
      <p className="card-text lead fs-2">CHECK OUR NEW ARRIVALS</p>

    </div>
  );
};

export default Home;
